import React from 'react';
// import '../../App.css';
import './order.css';

export default function Request(props) {
  const urlParams = new URLSearchParams(window.location.search);
  document.getElementById("id").innerHTML = urlParams.get("id");
document.getElementById("label").innerHTML = urlParams.get("label");
document.getElementById("vn").innerHTML = urlParams.get("vn");
document.getElementById("vm").innerHTML = urlParams.get("vm");
document.getElementById("ad").innerHTML = urlParams.get("ad");

  

  // const {id} = id
      return (
        <div className="order-confirmation-container">
          <h2 >Order Details</h2>
          <div className="order-details">
            <div className="order-item">
              <span>Service Type: </span>
              <span style={{
          color: 'brown',
        }} span>{label}</span>
            </div>
            <div className="order-item">
              <span>Location:</span>
              {/* <span>{this.props.match.params.order_id}</span> */}
              <span style={{
          color: 'brown',
        }}>{label}</span>
            </div>
            <div className="order-item">
              <span>Vehicle Type:</span>
              <span style={{
          color: 'brown',
        }}>Four Wheeler</span>
            </div>
            <div className="order-item">
              <span>Vehicle Make:</span>
              <span style={{
          color: 'brown',
        }}>{vm}</span>
            </div>
            <div className="order-item">
              <span >Vehicle Number:</span>
              <span style={{
          color: 'brown',
        }}>{vn}</span>
            </div>
            <div className="order-item">
              <span>Additional Details:</span>
              <span style={{
          color: 'brown',
        }}>{ad}</span>
            </div>
          </div>
          <p className="confirmation-message">
            Thank you for your order! Our team will be in touch with you shortly.
          </p>
        </div>
    //     <div>
            
        // </div>
    );}
